
BEGIN;
CREATE TABLE django_migrations (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, app varchar(255) NOT NULL, name varchar(255) NOT NULL, applied datetime NOT NULL);
CREATE TABLE auth_group (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(80) NOT NULL UNIQUE);
CREATE TABLE auth_group_permissions (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, group_id integer NOT NULL REFERENCES auth_group (id), permission_id integer NOT NULL REFERENCES auth_permission (id));
CREATE TABLE auth_user_groups (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, user_id integer NOT NULL REFERENCES auth_user (id), group_id integer NOT NULL REFERENCES auth_group (id));
CREATE TABLE auth_user_user_permissions (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, user_id integer NOT NULL REFERENCES auth_user (id), permission_id integer NOT NULL REFERENCES auth_permission (id));
CREATE TABLE django_admin_log (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, object_id text NULL, object_repr varchar(200) NOT NULL, action_flag smallint unsigned NOT NULL, change_message text NOT NULL, content_type_id integer NULL REFERENCES django_content_type (id), user_id integer NOT NULL REFERENCES auth_user (id), action_time datetime NOT NULL);
CREATE TABLE django_content_type (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, app_label varchar(100) NOT NULL, model varchar(100) NOT NULL);
CREATE TABLE auth_permission (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, content_type_id integer NOT NULL REFERENCES django_content_type (id), codename varchar(100) NOT NULL, name varchar(255) NOT NULL);
CREATE TABLE auth_user (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, password varchar(128) NOT NULL, last_login datetime NULL, is_superuser bool NOT NULL, first_name varchar(30) NOT NULL, last_name varchar(30) NOT NULL, email varchar(254) NOT NULL, is_staff bool NOT NULL, is_active bool NOT NULL, date_joined datetime NOT NULL, username varchar(150) NOT NULL UNIQUE);
CREATE TABLE blog_category (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(128) NOT NULL UNIQUE, overview varchar(40) NOT NULL, views integer NOT NULL);
CREATE TABLE blog_post (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, title varchar(22) NOT NULL, overview varchar(40) NOT NULL, content text NOT NULL, date datetime NOT NULL, author_id integer NOT NULL REFERENCES auth_user (id), category_id integer NOT NULL REFERENCES blog_category (id));
CREATE TABLE blog_comment (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, content text NOT NULL, date datetime NOT NULL, author_id integer NOT NULL REFERENCES auth_user (id), post_id integer NOT NULL REFERENCES blog_post (id));
CREATE TABLE build_citation_information (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, author_list varchar(100) NOT NULL, description varchar(1000) NOT NULL, editor_list varchar(100) NOT NULL, keyword varchar(100) NOT NULL, publication_year varchar(100) NOT NULL, bundle_id integer NOT NULL REFERENCES build_bundle (id));
CREATE TABLE build_collections (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, has_document bool NOT NULL, has_context bool NOT NULL, has_data bool NOT NULL, bundle_id integer NOT NULL UNIQUE REFERENCES build_bundle (id));
CREATE TABLE build_display_settings (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT);
CREATE TABLE build_facility (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, lid varchar(255) NOT NULL, name varchar(100) NOT NULL, type_of varchar(100) NOT NULL, version real NOT NULL, vid real NOT NULL, starbase_label varchar(100) NOT NULL);
CREATE TABLE build_instrument (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, lid varchar(255) NOT NULL, name varchar(100) NOT NULL, type_of varchar(100) NOT NULL, vid real NOT NULL, starbase_label varchar(100) NOT NULL);
CREATE TABLE build_instrument_host (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, lid varchar(255) NOT NULL, name varchar(100) NOT NULL, type_of varchar(100) NOT NULL, vid real NOT NULL, starbase_label varchar(100) NOT NULL);
CREATE TABLE build_instrument_host_instruments (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, instrument_host_id integer NOT NULL REFERENCES build_instrument_host (id), instrument_id integer NOT NULL REFERENCES build_instrument (id));
CREATE TABLE build_investigation (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(100) NOT NULL, type_of varchar(100) NOT NULL, lid varchar(255) NOT NULL, vid real NOT NULL, starbase_label varchar(100) NOT NULL);
CREATE TABLE build_mission (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(100) NOT NULL);
CREATE TABLE build_mission_investigation (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, mission_id integer NOT NULL REFERENCES build_mission (id), investigation_id integer NOT NULL REFERENCES build_investigation (id));
CREATE TABLE build_product_bundle (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, bundle_id integer NOT NULL UNIQUE REFERENCES build_bundle (id));
CREATE TABLE build_product_collection (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, collection varchar(100) NOT NULL, bundle_id integer NOT NULL REFERENCES build_bundle (id));
CREATE TABLE build_table (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(100) NOT NULL, observational_type varchar(100) NOT NULL, local_identifier varchar(100) NOT NULL, offset varchar(100) NOT NULL, object_length varchar(100) NOT NULL, description varchar(100) NOT NULL, records varchar(100) NOT NULL, fields varchar(100) NOT NULL, groups varchar(100) NOT NULL, product_observational_id integer NOT NULL REFERENCES build_product_observational (id));
CREATE TABLE build_target (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, lid varchar(255) NOT NULL, name varchar(100) NOT NULL, type_of varchar(100) NOT NULL, vid real NOT NULL, starbase_label varchar(100) NOT NULL);
CREATE TABLE build_telescope (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, lid varchar(255) NOT NULL, name varchar(100) NOT NULL, vid real NOT NULL, starbase_label varchar(100) NOT NULL);
CREATE TABLE build_telescope_facilities (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, telescope_id integer NOT NULL REFERENCES build_telescope (id), facility_id integer NOT NULL REFERENCES build_facility (id));
CREATE TABLE build_version (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, num varchar(4) NOT NULL, xml_model varchar(100) NOT NULL, xmlns varchar(100) NOT NULL, xsi varchar(100) NOT NULL, schemaLocation varchar(100) NOT NULL, schematypens varchar(100) NOT NULL);
CREATE TABLE build_displaydictionary (data_id integer NOT NULL PRIMARY KEY REFERENCES build_data (id));
CREATE TABLE build_table_fixed_width (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(256) NOT NULL, offset integer NOT NULL, object_length integer NOT NULL, description varchar(5000) NOT NULL, records integer NOT NULL, record_delimiter varchar(256) NOT NULL, fields integer NOT NULL, bundle_id integer NULL REFERENCES build_bundle (id), data_id integer NULL REFERENCES build_data (id));
CREATE TABLE build_table_delimited (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(256) NOT NULL, offset integer NOT NULL, object_length integer NOT NULL, description varchar(5000) NOT NULL, records integer NOT NULL, field_delimiter varchar(256) NOT NULL, fields integer NOT NULL, bundle_id integer NULL REFERENCES build_bundle (id), data_id integer NULL REFERENCES build_data (id));
CREATE TABLE build_table_binary (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(256) NOT NULL, offset integer NOT NULL, records integer NOT NULL, fields integer NOT NULL, bundle_id integer NULL REFERENCES build_bundle (id), data_id integer NULL REFERENCES build_data (id));
CREATE TABLE build_product_observational (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, domain varchar(100) NOT NULL, discipline varchar(100) NOT NULL, processing_level varchar(100) NOT NULL, purpose varchar(1000) NOT NULL, title varchar(100) NOT NULL, type_of varchar(100) NOT NULL, bundle_id integer NOT NULL REFERENCES build_bundle (id), data_id integer NOT NULL REFERENCES build_data (id));
CREATE TABLE build_instrument_host_investigations (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, instrument_host_id integer NOT NULL REFERENCES build_instrument_host (id), investigation_id integer NOT NULL REFERENCES build_investigation (id));
CREATE TABLE build_instrument_host_targets (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, instrument_host_id integer NOT NULL REFERENCES build_instrument_host (id), target_id integer NOT NULL REFERENCES build_target (id));
CREATE TABLE build_field_delimited (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(256) NOT NULL, field_number integer NOT NULL, data_type varchar(256) NOT NULL, unit varchar(256) NULL, description varchar(5000) NOT NULL, table_id integer NULL REFERENCES build_table_delimited (id));
CREATE TABLE build_field_character (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(256) NOT NULL, field_number integer NOT NULL, data_type varchar(256) NOT NULL, field_length integer NOT NULL, field_location varchar(256) NOT NULL, description varchar(5000) NOT NULL, table_id integer NULL REFERENCES build_table_fixed_width (id));
CREATE TABLE build_field_binary (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(256) NOT NULL, field_number integer NOT NULL, field_location varchar(256) NOT NULL, data_type varchar(256) NOT NULL, field_length integer NOT NULL, unit varchar(256) NULL, scaling_factor integer NOT NULL, value_offset integer NOT NULL, description varchar(5000) NOT NULL, table_id integer NULL REFERENCES build_table_binary (id));
CREATE TABLE build_facility_instruments (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, facility_id integer NOT NULL REFERENCES build_facility (id), instrument_id integer NOT NULL REFERENCES build_instrument (id));
CREATE TABLE build_data (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(100) NOT NULL, processing_level varchar(30) NOT NULL, bundle_id integer NOT NULL REFERENCES build_bundle (id));
CREATE TABLE build_bundle_facilities (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, bundle_id integer NOT NULL REFERENCES build_bundle (id), facility_id integer NOT NULL REFERENCES build_facility (id));
CREATE TABLE build_bundle_instrument_hosts (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, bundle_id integer NOT NULL REFERENCES build_bundle (id), instrument_host_id integer NOT NULL REFERENCES build_instrument_host (id));
CREATE TABLE build_bundle_instruments (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, bundle_id integer NOT NULL REFERENCES build_bundle (id), instrument_id integer NOT NULL REFERENCES build_instrument (id));
CREATE TABLE build_bundle_investigations (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, bundle_id integer NOT NULL REFERENCES build_bundle (id), investigation_id integer NOT NULL REFERENCES build_investigation (id));
CREATE TABLE build_bundle_targets (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, bundle_id integer NOT NULL REFERENCES build_bundle (id), target_id integer NOT NULL REFERENCES build_target (id));
CREATE TABLE build_bundle_telescopes (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, bundle_id integer NOT NULL REFERENCES build_bundle (id), telescope_id integer NOT NULL REFERENCES build_telescope (id));
CREATE TABLE build_array (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, name varchar(100) NOT NULL, array_dimensions varchar(100) NOT NULL, array_type varchar(100) NOT NULL, local_identifier varchar(100) NOT NULL, offset varchar(100) NOT NULL, axes varchar(100) NOT NULL, axis_index_order varchar(100) NOT NULL, description varchar(100) NOT NULL, product_observational_id integer NOT NULL REFERENCES build_product_observational (id));
CREATE TABLE build_alias (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, alternate_id varchar(100) NOT NULL, alternate_title varchar(100) NOT NULL, comment varchar(100) NOT NULL, bundle_id integer NOT NULL REFERENCES build_bundle (id));
CREATE TABLE build_movie_display_settings (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, time_display_axis integer unsigned NOT NULL, comment varchar(100) NOT NULL, frame_rate real NOT NULL, loop_flag bool NOT NULL, loop_count integer unsigned NOT NULL, loop_delay real NOT NULL, loop_delay_unit varchar(20) NOT NULL, loop_back_and_forth_flag bool NOT NULL, display_dictionary_id integer NOT NULL UNIQUE REFERENCES build_displaydictionary (data_id));
CREATE TABLE build_display_direction (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, comment_display_direction varchar(100) NOT NULL, horizontal_display_axis integer unsigned NOT NULL, horizontal_display_direction varchar(13) NOT NULL, vertical_display_axis integer unsigned NOT NULL, vertical_display_direction varchar(13) NOT NULL, display_dictionary_id integer NOT NULL UNIQUE REFERENCES build_displaydictionary (data_id));
CREATE TABLE build_color_display_settings (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, color_display_axis integer unsigned NOT NULL, comment_color_display varchar(100) NOT NULL, red_channel_band integer unsigned NOT NULL, green_channel_band integer unsigned NOT NULL, blue_channel_band integer unsigned NOT NULL, display_dictionary_id integer NOT NULL UNIQUE REFERENCES build_displaydictionary (data_id));
CREATE TABLE friends_updateagency (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, agency varchar(10) NOT NULL);
CREATE TABLE friends_updateemail (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, email varchar(256) NOT NULL);
CREATE TABLE friends_updatenamefirst (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, first_name varchar(256) NOT NULL);
CREATE TABLE friends_updatenamelast (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, last_name varchar(256) NOT NULL);
CREATE TABLE friends_updatepassword (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, current_password varchar(256) NOT NULL, new_password varchar(256) NOT NULL, confirm_password varchar(256) NOT NULL);
CREATE TABLE friends_userprofile (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, agency varchar(10) NOT NULL, directory varchar(1000) NOT NULL, user_id integer NOT NULL UNIQUE REFERENCES auth_user (id));
CREATE TABLE main_joke (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, question varchar(500) NOT NULL UNIQUE, answer varchar(500) NOT NULL, likes integer NOT NULL);
CREATE TABLE main_uploadeddocument (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, description varchar(255) NOT NULL, document varchar(100) NOT NULL, uploaded_at datetime NOT NULL);
CREATE TABLE django_session (session_key varchar(40) NOT NULL PRIMARY KEY, session_data text NOT NULL, expire_date datetime NOT NULL);
CREATE TABLE build_product_document (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, acknowledgement_text varchar(100) NOT NULL, author_list varchar(100) NOT NULL, copyright varchar(100) NOT NULL, description varchar(100) NOT NULL, document_editions varchar(100) NOT NULL, document_name varchar(100) NOT NULL, doi varchar(100) NOT NULL, editor_list varchar(100) NOT NULL, publication_date varchar(100) NOT NULL, revision_id varchar(100) NOT NULL, bundle_id integer NOT NULL REFERENCES build_bundle (id), modification_date varchar(100) NOT NULL, version_id varchar(100) NOT NULL);
CREATE TABLE build_bundle (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, bundle_type varchar(12) NOT NULL, name varchar(100) NOT NULL UNIQUE, status varchar(1) NOT NULL, user_id integer NOT NULL REFERENCES auth_user (id), version varchar(4) NOT NULL);
CREATE TABLE build_modification_history (id integer NOT NULL PRIMARY KEY AUTO_INCREMENT, description varchar(1000) NOT NULL, version_id varchar(100) NOT NULL, modification_date varchar(100) NOT NULL, bundle_id integer NOT NULL REFERENCES build_bundle (id));
